import React, { Component } from 'react';
import Square from './Square';

export default class Board extends Component {

    // constructor(props) {
    //     super(props);
    // }

    renderSquare(i) {

        // console.log(i);

        return (
            <Square value = {this.props.squares[i]}
            onClick = {(i) => this.props.handleClick(i)}
            />
        )
    }

    render() {
        return (
            <div>
                <div className = "border-row">
                    {this.renderSquare(0)}
                    {this.renderSquare(1)}
                    {this.renderSquare(2)}
                </div>
                <div className = "border-row">
                    {this.renderSquare(3)}
                    {this.renderSquare(4)}
                    {this.renderSquare(5)}
                </div>
                <div className = "border-row">
                    {this.renderSquare(6)}
                    {this.renderSquare(7)}
                    {this.renderSquare(8)}
                </div>
            </div>
        )
    }
};
